import React from 'react'
import dataPains from './dataPains'

const ImagePains = () => {

    const data= dataPains.map(pain=>(         
               <img src={pain.image} alt="photos"className='imgspec'/>
                                ))

    const data1= dataPains.map(pain=>(         
        <h5>{pain.name}</h5>
                                ))

    const data2= dataPains.map(pain=>(         
            <h5>{pain.description}</h5>
                                                            ))





    return (
        <div>
            {data}
            {data1}
            {data2}
        </div>
    )
}

export default ImagePains
